result:
query($slug: String!) {
  strapi {
    properties(where: { slug: $slug }) {
      title
      slug
      latitude
      longitude
      address
      location
      status
      bedrooms
      bathroom
      price
      description
      area
      developerName
      project_status {
        name
        slug
      }
      property_type {
        name
        slug
      }
      property_status {
        id
        name
        slug
      }
      images {
        url
      }
    }
    global {
      siteName
      favicon {
        url
      }
      defaultSeo {
        metaTitle
        metaDescription
        shareImage {
          url
        }
      }
    }
  }
}
